## Remarks  
 Wszystkie dane zdarzeń (Trace lub Debug) ze zdarzenia źródłowego są zapisywane w podsystemie ETW jako ciąg. Elementy danych są rozdzielane przecinkami. Aby określić inny ogranicznik, użyj <xref:System.Diagnostics.Eventing.EventProviderTraceListener.Delimiter%2A> właściwości.  
  
 Dodawanie odbiornika do <xref:System.Diagnostics.TraceSource?displayProperty=nameWithType> rejestrowania dostawcy w podsystemie ETW. Aby zapisać zdarzenia w pliku dziennika, należy utworzyć sesję śledzenia ETW przy użyciu programu wykonywalnego logman. exe (lub innego podobnego).  
  
 Nie jest potrzebny manifest do korzystania z zdarzeń z odbiornika, ponieważ dane zdarzenia są pojedynczym ciągiem.  
  
 Po wywołaniu <xref:System.Diagnostics.TraceSource?displayProperty=nameWithType> metod pisania zdarzeń należy <xref:System.Diagnostics.TraceEventType?displayProperty=nameWithType> przekazać wartość wyliczenia. Wyliczenie zawiera wartości poziomu i słowa kluczowego. Po włączeniu dostawcy odbiornika śledzenia z sesji ETW, określona wartość poziomu może być wartością skojarzoną z jedną z następujących <xref:System.Diagnostics.TraceEventType?displayProperty=nameWithType> wartości wyliczenia:  
  
-   Krytyczny (wartość to 1)  
  
-   Błąd (wartość jest równa 2)  
  
-   Informacje (wartość to 8)  
  
-   Verbose (wartość to 16)  
  
-   Ostrzeżenie (wartość to 4)  
  
 Wartość słowa kluczowego określona dla sesji może być wartością skojarzoną z jedną z następujących <xref:System.Diagnostics.TraceEventType?displayProperty=nameWithType> wartości wyliczenia:  
  
-   Resume (wartość to 2 048)  
  
-   Rozpocznij (wartość to 256)  
  
-   Stop (wartość to 512)  
  
-   Suspend (wartość to 1 024)  
  
-   Transfer (wartość to 4 096)  
  
   
  
## Examples  
  
```csharp  
private static Guid providerId = new Guid("{B3F0C8FC-E8A8-4868-8901-1465E8A2F41B}");  
  
    EventProviderTraceListener listener = new EventProviderTraceListener(providerId.ToString(), "Test Listener", "::");  
  
    // You should use the All default level and control the level using the  
    // ETW session; otherwise, you may not log all the events requested by the  
    // session.  
    TraceSource source = new TraceSource("MyProvider", SourceLevels.All);  
  
    source.Listeners.Add(listener);  
  
    source.TraceData(TraceEventType.Warning | TraceEventType.Start, 2, new object[] { "abc", "def", true, 123 });  
  
    source.TraceEvent(TraceEventType.Warning, 12, "Provider guid: {0}", new object[] { providerId });  
  
    source.TraceInformation("string {0}, bool {1}, int {2}, ushort {3}", new object[] { "abc", false, 123, (UInt32)5 });  
```
